Big budget parody porn! In the adult DVD The Lone Ranger XXX: An Extreme Comixxx Parody, The Wild West was one of the most exciting times in American history. From it stemmed great tales of legendary heroes and dastardly villains. One such great tale was The Lone Ranger and his run-ins with Butch Cavendish. Stars Adrianna Luna, Christie Stevens, and more!

In our story, Butch and his gang ambush The Texas Rangers in an attempt to take over the territory. Butch's plan almost worked, except they failed to kill one ranger who was left for dead. But they didn't count on Tonto, a friend from the rangers past. Tonto nursed the ranger back to health and helped him put an end to the iron grip that held the townspeople hostage!



